contracts/CovidNaccineTracker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract  CovidVaccineTracker{
    
    struct Beneficiary{
        string beneficiaryName;
        uint bAge;
        string bGender;
        uint bIdProof;
        string bVaccineName;
        uint vaccineReferenceId;
        uint bDateOfVaccine;
        DoseNumber bDoseNumber;
    }

    mapping(string=>Beneficiary) beneficiaries;

    enum DoseNumber{
        first,
        second
    }

    

function addReceipientWithForFirstDose(string memory _name,uint _age,string  memory _gender, uint _idProof,string memory _vaccineName,uint _vaccineReferenceId, uint _dateOfVaccine)public{
    Beneficiary storage newBeneficiary=beneficiaries[_name];
    newBeneficiary.beneficiaryName=_name;
    newBeneficiary.bAge=_age;
    newBeneficiary.bGender=_gender;
    newBeneficiary.bIdProof=_idProof;   
    beneficiaries[_name]. bVaccineName=_vaccineName;
    beneficiaries[_name].vaccineReferenceId=_vaccineReferenceId;
    beneficiaries[_name].bDateOfVaccine=_dateOfVaccine;
}


function updateVaccineDosage(string memory _name) public pure returns(string memory){
       return string(abi.encodePacked(_name," successfully vaccined with ","first"," dose"));
 }
    

}

